// Header.js
import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

function Header() {
    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6">
                    Patent Management System
                </Typography>
            </Toolbar>
        </AppBar>
    );
}

export default Header;
